import Navbar from '../NavBar/NavBarSGI';
import React, { useEffect, useState } from "react";
import Conexao from '../../Config/conexao';
import axios from 'axios';
import moment from 'moment';



export default function Epis(){

const [nome,setNome]=useState();
const [funcao,setFuncao]=useState();
const [mudancaFuncao,setMudancaFuncao]=useState();
const [admissao,setAdmissao]=useState();
const [setor,setSetor]=useState();

const [data,setData]=useState();
const [qtd,setQtd]=useState();
const [und,setUnd]=useState();
const [descricaoEpi,setDescricaoEpi]=useState();
const [camte,setCamte]=useState();

function Confirmacao(){
    alert ('Dados Salvos com sucesso')
};

function Limpar(){
setNome('');
setFuncao('');
setMudancaFuncao('');
setAdmissao('');
setSetor('');

setData('');
setQtd('');
setUnd();
setDescricaoEpi('');
setCamte('');

};


async function add() {  
    const obj = { setor, nome, mudancaFuncao, admissao, funcao };  
    const res = await axios.post(Conexao.api+ 'InsertFuncionariosEpiWEB.php', obj);

    if (res.data.success === true) { } 
    Confirmacao();
    Limpar();     
  };
    




    return <body >
      

<Navbar />

      <br/>
      <div className='titulolaboratorio container-fluid '>
        <h1 className='texttitulo'>EPI'S</h1>
      </div> 

      <br/><br/><br/>




      <body className='container text-center d-flex'>
      <div class="col  align-items-center justify-content-center p-2 ">
    <div class="row d-flex align-items-center justify-content-center ">

        <div className='col'>
            <h6> Nome do funcionário</h6>
            <input className='form-control text-center ' onChange={(e) => setNome(e.target.value)} value={nome}></input>
        </div>

        <div className='col'>
            <h6> Função</h6>
            <input className='form-control text-center ' onChange={(e) => setFuncao(e.target.value)} value={funcao}></input>
        </div>
        <div className='col'>
            <h6>Mudança de função</h6>
            <input className='form-control text-center ' onChange={(e) => setMudancaFuncao(e.target.value)} value={mudancaFuncao}></input>
        </div>
        <div className='col'>
            <h6> Admissão</h6>
            <input type='date' className='form-control text-center ' onChange={(e) => setAdmissao(e.target.value)} value={admissao}></input>
        </div>

        <div className='col'>
            <h6> Setor</h6>
            <input className='form-control text-center ' onChange={(e) => setSetor(e.target.value)} value={setor}></input>
        </div>

        </div>
        </div>
      </body>



      <div class="d-grid gap-2 d-md-flex justify-content-md-end bbb mt-5">
        <button  class="btnlogin  me-md-2 " data-bs-toggle="modal" data-bs-target="#ModalEntrega" > Entrega de EPI's / Inspeção</button>
      </div>



      <div class="modal" id="ModalEntrega" tabindex="" aria-labelledby="ModalEditarLabel" aria-hidden="true">
  <div class="modal-dialog modal-dialog-centered modal-xl">
    <div class="modal-content">
      <div class="modal-header">
        <h1 class="modal-title fs-5" id="ModalEditarLabel">Entrega de EPI's / Inspeção</h1>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>

      <div class="modal-body">
      <div class="container text-center  ">
     <div class="col  align-items-center justify-content-center p-2 ">
        <div class="row d-flex align-items-center justify-content-center ">
       
    
        <div className='col text-center me-2'>
            <h6>Data </h6>
            <input type='date' className=' form-control align-items-center text-center colorInput ' onChange={(e) => setData(e.target.value)} value={data}  >                      
             
          </input> 
        </div>

        <div className='col-1 text-center me-2'>
            <h6>Qtd </h6>
            <input className='form-control text-center  p-1' onChange={(e) => setQtd(e.target.value)} value={qtd} ></input>
        </div>
        <div className='col-1 text-center me-2'>
            <h6>Und </h6>
            <input  className='form-control text-center  p-1 ' onChange={(e) => setUnd(e.target.value)} value={und} ></input>
        </div>
        <div className='col text-center '>
            <h6>Descrição do Epi</h6>
            <input  className='form-control text-center  p-1' onChange={(e) => setDescricaoEpi(e.target.value)} value={descricaoEpi} ></input>
        </div>
        <div className='col-2 text-center '>
            <h6>CA - MTE</h6>
            <input  className='form-control text-center  p-1' onChange={(e) => setCamte(e.target.value)} value={camte} ></input>
        </div>
 
    

        </div>
      </div>
     </div>
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal" >Fechar</button>             
        <button type="button" class="btn btn-success"  data-bs-dismiss="modal" >Salvar</button>
      </div>
    </div>
  </div>
   
</div>


<div class="d-grid gap-2 d-md-flex justify-content-md-end bbb mt-5">
        <button  onClick={(e)=>add(e)} class="btnlogin  me-md-2 "  > Salvar</button>
      </div>





    </body>
 
};
